import Mock from 'mockjs'
const Random = Mock.Random;
Mock.mock('/user/upload', 'post', (options) => {
    console.log(JSON.parse(options.body));
    return { "result": {}, "success": true, "error": null, "unAuthorizedRequest": false };    
});
export default Mock
